import React from "react";
import map from "../images/worldmap.png"
import "./Contactus.css";
function Contactus() {
  return (
    <div >
      <div class="world-map">
        <img src={map} alt=""></img>
      <div class= "blink"></div><span class="india">Mumbai,India</span>
        <div class="pin India"></div>
      </div>
    </div>
  );
}

export default Contactus;
